function generateSeats() {
  const seats = [];
  const rows = 8;
  const cols = 10;
  for (let r = 0; r < rows; r++) {
    for (let c = 0; c < cols; c++) {
      seats.push({ seatNumber: `${String.fromCharCode(65 + r)}${c + 1}`, isBooked: false });
    }
  }
  return seats;
}

async function seed() {
  await mongoose.connect(process.env.MONGO_URI, { useNewUrlParser: true, useUnifiedTopology: true });
  await Show.deleteMany();
  for (const show of showsData) {
    await Show.create({ ...show, seats: generateSeats() });
  }
  console.log('Database seeded with shows and seats!');
  mongoose.disconnect();
}

seed(); 